import React from "react";
import PostsListItem from "../BlogContent/PostsList/PostsListItem";
import "./index.scss";

function Post({ post, readme }) {
  return (
    post && (
      <div className="post">
        <PostsListItem post={post} />
        <img
          src="https://live.yithemes.com/bazar/wp-content/uploads/sites/73/2013/01/011.jpg"
          alt=""
        />
        <p
          className="post__content"
          dangerouslySetInnerHTML={{ __html: readme || post.content }}
        ></p>
      </div>
    )
  );
}

export default Post;
